Tag name : Simplest of the CSS selectors is any HTML tag name. Consider the following examples: p{ <CSS declaration 1>
} div{ <CSS declaration 2>
} <CSS declaration 1> will be applied to all <p> tags and <CSS declaration 2> will be applied to all <div> tags. Tag id : CSS declaration can be applied to a tag with a specific id by using the # prefix. For e.g.: #first{ <CSS declaration 1>
} #second{ <CSS declaration 2>
} <CSS declaration 1> will be applied to a tag that has id='first' and <CSS declaration 2> will be applied to a tag with id='second'. Class name : a CSS declaration can be applied to a tags with a specific class by using the . prefix. Example: .first{ <CSS declaration 1>
} .second{ <CSS declaration 2>
} <CSS declaration 1> will be applied to all tags that have a class first and <CSS declaration 2> will be applied to all tags with the class name second.

