Selectors can be combined by using commas (,). For example instead of rewriting the <CSS declaration> like this: #first{ <CSS declaration>
} .second{ <CSS declaration>
} They can be combined like this: #first, .second{ <CSS declaration>
} Selectors written without spaces refer to tags that have all applicable selectors: For example: div#first.second{ <CSS declaration>
} The <CSS selector> will be applied to the <div> tag that has [id='first'] and a class second.'

